    //将侧边栏封装到index.js中
    render() {
        console.log(this.props);
        let defaultkey = this.props.location.pathname;
        console.log(defaultkey);

        return (
            <Sider trigger={null} collapsible collapsed={this.props.collapsed}>
                <div className="logo">
                    <Link className='left-nav-link' to='/home'>
                        <img src={Logo} alt="" />
                        <h1>find a service</h1>
                    </Link>
                </div>

                <Menu
                    theme="dark"
                    defaultSelectedKeys={defaultkey}
                    mode="inline"
                >
                    <Menu.Item key="/home">
                        <DesktopOutlined />
                        <Link to='/home'></Link>
                        HOME
                    </Menu.Item>
                    <Menu.Item key="/menu">
                        <AppstoreOutlined />
                        SERVICE MENU
                        <Link to='/menu'></Link>
                    </Menu.Item>
                    <Menu.Item key="/record">
                        <TeamOutlined />
                        CURRENT SERVICE
                        <Link to='/record'></Link>
                    </Menu.Item>
                    <Menu.Item key="/history">
                        <HistoryOutlined />
                        HISTORY SERVICE
                        <Link to='/history'></Link>
                    </Menu.Item>
                    <Menu.Item key="/user">
                        <UserOutlined />
                        USER INFORMATION
                        <Link to='/user'></Link>
                    </Menu.Item>
                </Menu>
            </Sider>

        )
    }
}
export default withRouter(LeftNav);
